from typing import List

class Solution:
    def products(self,nums:List[int])->int:
        results=nums[0]
        for i in range(1,len(nums)):
            results=results*nums[i]
        return results
    def maxProduct_slow(self, nums: List[int]) -> int:
        global_max=nums[0]
        for i in range(len(nums)):
            for j in range(i,len(nums)):
                global_max=max(global_max,self.products(nums[i:j+1]))
        return global_max

    def maxProduct(self,nums:List[int])->int:
        #the largest/smallest of subarray ending at an element
        cur_max,cur_min,solution=nums[0],nums[0],nums[0]
        for i in range(1,len(nums)):
            cur_max_copy,cur_min_copy=cur_max,cur_min
            cur_max=max(cur_max_copy*nums[i],cur_min_copy*nums[i],nums[i])
            cur_min=min(cur_max_copy*nums[i],cur_min_copy*nums[i],nums[i])
            solution=max(solution,cur_max)
        return solution



